import React from "react";
import css from "@emotion/css";

const RightInfo = ({ pInfo }) => {
  const rhProfileData = pInfo && pInfo.profile;
  return (
    <React.Fragment>
      <div
        css={css`
          background-color: #e6e6e6;
        `}
      >
        <div className="block"></div>
      </div>
    </React.Fragment>
  );
};

export default RightInfo;
